import React from "react";
import logo from "./logo.svg";
import Navbar from "react-bootstrap/Navbar";
import "./App.css";

function App() {
  return (
    <>
      <Navbar bg="light">
        <Navbar.Brand href="#home">Brand link</Navbar.Brand>
      </Navbar>
    </>
  );
}

export default App;
